// src/pages/Home.js
import React, { useState } from "react";
import { Card, CardContent, Button, Typography, Grid, Paper, CircularProgress } from "@mui/material";

const API_URL = "http://localhost:8000"; // Update with your backend URL

const Home = () => {
  const [folder, setFolder] = useState([]);
  const [imageList, setImageList] = useState([]);
  const [referenceImage, setReferenceImage] = useState(null);
  const [matchedImages, setMatchedImages] = useState([]);
  const [loading, setLoading] = useState(false);

  // üìÇ Handle Folder Upload
  const handleFolderUpload = async (event) => {
    const files = event.target.files;
    if (files) {
      setFolder(files);
      setImageList(Array.from(files).map((file) => URL.createObjectURL(file)));

      const formData = new FormData();
      for (let i = 0; i < files.length; i++) {
        formData.append("files", files[i]);
      }

      try {
        const response = await fetch(`${API_URL}/upload-folder/`, {
          method: "POST",
          body: formData,
        });

        const data = await response.json();
        console.log("Folder Upload Response:", data);
      } catch (error) {
        console.error("Error uploading folder:", error);
      }
    }
  };

  // üñº Handle Reference Image Upload
  const handleImageSelect = async (event) => {
    const file = event.target.files[0];
    if (file) {
      setReferenceImage(URL.createObjectURL(file));

      const formData = new FormData();
      formData.append("file", file);

      try {
        const response = await fetch(`${API_URL}/upload-reference/`, {
          method: "POST",
          body: formData,
        });

        const data = await response.json();
        console.log("Reference Image Upload Response:", data);
      } catch (error) {
        console.error("Error uploading reference image:", error);
      }
    }
  };

  // üîç Scan for Matched Images
  const handleScan = async () => {
    if (!referenceImage) {
      alert("Please select a reference image to scan.");
      return;
    }

    setLoading(true);
    try {
      const response = await fetch(`${API_URL}/scan/`);
      const data = await response.json();

      if (data.matched_images && Array.isArray(data.matched_images)) {
        // Ensure matched images are prefixed with full API URL
        setMatchedImages(data.matched_images.map(img => `${API_URL}/uploads/${img}`));
      console.log("Matched Images:", data.matched_images);
    } else {
      console.error("Unexpected API response:", data);
      setMatchedImages([]);
    }
  } catch (error) {
    console.error("Error scanning images:", error);
    setMatchedImages([]);
  }
  setLoading(false);
};

  return (
    <Card sx={{ maxWidth: 500, margin: "auto", mt: 5, p: 3, textAlign: "center", boxShadow: 3, borderRadius: 2 }}>
      <CardContent>
        <Typography variant="h4" fontWeight="bold" gutterBottom>
          PersonaScan
        </Typography>

        {/* üìÇ Upload Folder */}
        <Button variant="contained" color="primary" fullWidth component="label" sx={{ mb: 2, py: 1.5 }}>
          Upload Folder
          <input type="file" webkitdirectory="" directory="" hidden onChange={handleFolderUpload} multiple />
        </Button>

        {/* üñº Display Uploaded Images */}
        {imageList.length > 0 && (
          <Grid container spacing={1} justifyContent="center" sx={{ mb: 2 }}>
            {imageList.map((src, index) => (
              <Grid item key={index}>
                <Paper sx={{ width: 70, height: 70, overflow: "hidden", boxShadow: 1 }}>
                  <img src={src} alt={`uploaded-${index}`} style={{ width: "100%", height: "100%", objectFit: "cover" }} />
                </Paper>
              </Grid>
            ))}
          </Grid>
        )}

        {/* üñº Upload Reference Image */}
        {imageList.length > 0 && (
          <Button variant="contained" color="primary" fullWidth component="label" sx={{ mb: 2, py: 1.5 }}>
            Reference Image
            <input type="file" hidden onChange={handleImageSelect} />
          </Button>
        )}

        {/* üéØ Display Reference Image */}
        {referenceImage && (
          <Paper sx={{ width: 100, height: 100, overflow: "hidden", margin: "auto", mb: 2, boxShadow: 2 }}>
            <img src={referenceImage} alt="reference" style={{ width: "100%", height: "100%", objectFit: "cover" }} />
          </Paper>
        )}

        {/* üîç Scan Button */}
        <Button variant="contained" color="success" fullWidth sx={{ py: 1.5, mb: 2 }} onClick={handleScan} disabled={loading}>
          {loading ? <CircularProgress size={24} color="inherit" /> : "Scan"}
        </Button>

        {/* ‚úÖ Display Matched Images */}
        {matchedImages.length > 0 && (
          <>
            <Typography variant="h6" fontWeight="bold" gutterBottom>
              Matched Photos
            </Typography>
            <Grid container spacing={1} justifyContent="center">
              {matchedImages.map((image, index) => (
                <Grid item key={index}>
                  <Paper sx={{ width: 70, height: 70, overflow: "hidden", boxShadow: 1 }}>
                    <img src={`${API_URL}/uploads/${image}`} alt={`matched-${index}`} style={{ width: "100%", height: "100%", objectFit: "cover" }} />
                  </Paper>
                </Grid>
              ))}
            </Grid>
          </>
        )}
      </CardContent>
    </Card>
  );
};

export default Home;
